SELECT ?commander ?spouse ?author2 WHERE {
  # Part 1: Commander in the war that is a disease and societal event of United States Navy
  ?event rdf:type dbo:Disease .
  ?event rdf:type dbo:SocietalEvent .
  ?event dbo:agent dbr:United_States_Navy .
  ?event dbo:commander ?commander .

  # Part 2: Spouse of the author who is a politician and office holder related to Hillary Clinton's work
  ?work1 rdf:type dbo:Book ;
         dbo:author ?author .
  ?author rdf:type dbo:Politician ;
          dbo:officeHolder true .
  ?author dbo:spouse ?spouse .
  ?work1 dbo:wikiPageRedirects dbr:Hillary_Clinton .

  # Part 3: Author of the work related to the resident in Chappaqua, New York
  ?resident rdf:type dbo:Politician ;
            dbo:officeHolder true ;
            dbo:residence dbr:Chappaqua,_New_York .
  ?work2 rdf:type dbo:Book ;
         rdf:type dbo:WrittenWork ;
         dbo:author ?author2 .
  ?resident dbo:authored ?work2 .
}

SELECT ?nativeCountry ?manager WHERE {
    # Theodor Heuss's country
    ?country dbpedia:leader <http://dbpedia.org/resource/Theodor_Heuss> .

    # Sports manager born on 1968-08-26
    ?sportsManager a dbo:SportsManager ;
                   dbo:birthDate "1968-08-26"^^xsd:date ;
                   dbo:birthPlace ?nativeCountry .

    # Manager of the team
    ?team a dbo:SoccerClubSeason, dbo:SportsSeason, dbo:SportsTeamSeason ;
          dbo:manager ?sportsManager .

    # Successor of 2006–07 VfL Bochum season
    ?successor a dbo:FootballLeagueSeason, dbo:SportsTeamSeason, dbo:SportsSeason ;
               dbo:predecessor <http://dbpedia.org/resource/2007%E2%80%9308_VfL_Bochum_season> .

    # Player's club
    ?playerClub a dbo:SportsClub, dbo:Organization, dbo:SoccerClub ;
                dbo:team ?successor .

    # Manager of the player's club
    ?manager a dbo:Person ;
             dbo:manager ?playerClub .
}

SELECT ?force1 ?commander WHERE {
  # Step 1: Identify the awardee of Knight Commander of the Order of the Bath
  ?awardee dbo:award "Knight Commander of the Order of the Bath" .

  # Step 2: Find the military force related to this awardee as an event and societal event
  ?force1 dbo:event ?awardee ;
          a dbo:SocietalEvent .

  # Step 3: Identify the war referenced by William Bayne
  ?war dbo:name "William Bayne" ;
       a dbo:MilitaryConflict, dbo:Event .

  # Step 4: Determine the commander of the 30th (Cambridgeshire) Regiment of Foot in this war
  ?commander dbo:commanded <http://dbpedia.org/resource/30th_(Cambridgeshire)_Regiment_of_Foot> ;
             dbo:participatedIn ?war .

  # Step 5: Retrieve the military force for the war referenced by William Bayne
  ?force2 dbo:event ?war ;
          a dbo:MilitaryConflict .
}

SELECT ?result
WHERE {
    # Find the organization that matches the description of Hong Kong C
    ?org a dbo:SportsClub ;
         a dbo:SoccerClub ;
         a dbo:SportsTeam ;
         foaf:name "Hong Kong C"@en .

    # Identify the manager who is both a sports manager and soccer manager for this organization
    ?manager a dbo:SportsManager ;
             a dbo:SoccerManager ;
             dbo:manager ?org .

    # Find players associated with this manager
    ?player dbo:team ?manager .

    # Find the person born on 1981-12-01 who is an athlete, soccer player, sports manager, and soccer manager
    ?person a dbo:Athlete ;
            a dbo:SoccerPlayer ;
            a dbo:SportsManager ;
            a dbo:SoccerManager ;
            dbo:birthday "1981-12-01"^^xsd:date .

    # Find players associated with this person
    ?player2 dbo:team ?person .

    # Ensure the player is common to both conditions
    FILTER (?player = ?player2)
}

